import { useState } from 'react';
import Card from 'react-bootstrap/Card';


const Logo = () => {
  return (
    <>
      
      <Card>
        <Card.Img variant="top" className='m-auto' src="./metro-logo.jpg" style={{maxHeight:'20%',maxWidth:'20%'}}/>
        <Card.Body>
          <Card.Text>
            Some quick example text to build on the card title and make up the
            bulk of the card's content.
          </Card.Text>
        </Card.Body>
      </Card>
    </>
  );
}

export default Logo;
